import { ReactDOM } from 'react';

const [items, set] = React.useState([]);

React.useEffect(() => {
    fetch.get('https://6bd641e120585a10.mokky.dev/filmsDetails')
    .then((res) => res.json)
    .then((data) => data);
}, []);

const filmsDetails = ({ title, genre, season }) => {
    return( 
        <div>
            <p>{title}</p>
            <p>{genre}</p>
            <p>{season}</p>
        </div>
    );
}

export default filmsDetails;
